Entries.RequestBody:
{
  "properties": {
    "template": {
      "$schema": "https://schema.management.azure.com/schemas/2019-04-01/deploymentTemplate.json#",
      "contentVersion": "1.0.0.0",
      "parameters": {
        "vaultName": {
          "type": "string",
          "metadata": {
            "description": "Specifies the name of the key vault."
          }
        },
        "location": {
          "type": "string",
          "defaultValue": "",
          "metadata": {
            "description": "Specifies the Azure location where the key vault should be created."
          }
        },
        "enabledForDeployment": {
          "type": "bool",
          "defaultValue": true,
          "allowedValues": [
            true,
            false
          ],
          "metadata": {
            "description": "Specifies whether Azure Virtual Machines are permitted to retrieve certificates stored as secrets from the key vault."
          }
        },
        "enabledForDiskEncryption": {
          "type": "bool",
          "defaultValue": true,
          "allowedValues": [
            true,
            false
          ],
          "metadata": {
            "description": "Specifies whether Azure Disk Encryption is permitted to retrieve secrets from the vault and unwrap keys."
          }
        },
        "enabledForTemplateDeployment": {
          "type": "bool",
          "defaultValue": true,
          "allowedValues": [
            true,
            false
          ],
          "metadata": {
            "description": "Specifies whether Azure Resource Manager is permitted to retrieve secrets from the key vault."
          }
        },
        "tenantId": {
          "type": "string",
          "defaultValue": "",
          "metadata": {
            "description": "Specifies the Azure Active Directory tenant ID that should be used for authenticating requests to the key vault. Get it by using Get-AzSubscription cmdlet."
          }
        },
        "objectId": {
          "type": "string",
          "metadata": {
            "description": "Specifies the object ID of a user, service principal or security group in the Azure Active Directory tenant for the vault. The object ID must be unique for the list of access policies. Get it by using Get-AzADUser or Get-AzADServicePrincipal cmdlets."
          }
        },
        "skuName": {
          "type": "string",
          "defaultValue": "Standard",
          "allowedValues": [
            "Standard",
            "Premium"
          ],
          "metadata": {
            "description": "Specifies whether the key vault is a standard vault or a premium vault."
          }
        },
        "secretName": {
          "type": "string",
          "metadata": {
            "description": "Specifies the name of the secret that you want to create."
          }
        },
        "secretValue": {
          "type": "securestring",
          "metadata": {
            "description": "Specifies the value of the secret that you want to create."
          }
        },
        "secretName2": {
          "type": "string",
          "metadata": {
            "description": "Specifies the name of the secret that you want to create."
          }
        },
        "secretValue2": {
          "type": "securestring",
          "metadata": {
            "description": "Specifies the value of the secret that you want to create."
          }
        }
      },
      "resources": [
        {
          "type": "Microsoft.KeyVault/vaults",
          "apiVersion": "2019-09-01",
          "name": "[parameters('vaultName')]",
          "location": "[parameters('location')]",
          "properties": {
            "enabledForDeployment": "[parameters('enabledForDeployment')]",
            "enabledForDiskEncryption": "[parameters('enabledForDiskEncryption')]",
            "enabledForTemplateDeployment": "[parameters('enabledForTemplateDeployment')]",
            "tenantId": "[parameters('tenantId')]",
            "accessPolicies": [
              {
                "objectId": "[parameters('objectId')]",
                "tenantId": "[parameters('tenantId')]",
                "permissions": {
                  "keys": [
                    "all"
                  ],
                  "secrets": [
                    "all"
                  ]
                }
              }
            ],
            "sku": {
              "name": "[parameters('skuName')]",
              "family": "A"
            },
            "networkAcls": {
              "defaultAction": "Allow",
              "bypass": "AzureServices"
            }
          }
        },
        {
          "type": "Microsoft.KeyVault/vaults/secrets",
          "apiVersion": "2019-09-01",
          "name": "[concat(parameters('vaultName'), '/', parameters('secretName'))]",
          "location": "[parameters('location')]",
          "dependsOn": [
            "[resourceId('Microsoft.KeyVault/vaults', parameters('vaultName'))]"
          ],
          "properties": {
            "value": "[parameters('secretValue')]"
          }
        },
        {
          "type": "Microsoft.KeyVault/vaults/secrets",
          "apiVersion": "2019-09-01",
          "name": "[concat(parameters('vaultName'), '/', parameters('secretName2'))]",
          "location": "[parameters('location')]",
          "dependsOn": [
            "[resourceId('Microsoft.KeyVault/vaults', parameters('vaultName'))]"
          ],
          "properties": {
            "value": "[parameters('secretValue2')]"
          }
        }
      ]
    },
    "parameters": {
      "vaultName": {
        "value": "ps109"
      },
      "location": {
        "value": "East US"
      },
      "tenantId": {
        "value": "72f988bf-86f1-41af-91ab-2d7cd011db47"
      },
      "objectId": {
        "value": "bc93052d-397e-4fba-b486-f5915bfd2a53"
      },
      "skuName": {
        "value": "Standard"
      },
      "secretName": {
        "value": "CAK"
      },
      "secretValue": {
        "value": "b4355b9ccaf727d2ba7744ee991ce00e"
      },
      "secretName2": {
        "value": "CKN"
      },
      "secretValue2": {
        "value": "93e9ce8469eff0536784fc4ad253b5a6"
      }
    },
    "mode": "Incremental"
  }
}

